import React, { Component } from "react";

export class Address extends Component {
  state = {
    step: 1,
    firstName: "",
    lastName: "",
    phoneNumber: "",
    email: "",
    blockNumber: "",
    streetName: "",
    unitNumber: "",
    postalCode: "",
  };

  // Proceed to next step
  nextStep = () => {
    const { step } = this.state;
    this.setState({
      step: step + 1,
    });
  };

  // Proceed to prev step
  prevStep = () => {
    const { step } = this.state;
    this.setState({
      step: step - 1,
    });
  };

  // Handle fields change
  handleChange = (input) => (e) => {
    this.setState({ [input]: e.target.value });
  };

  render() {
    const { step } = this.state;
    const {
      firstName,
      lastName,
      phoneNumber,
      email,
      blockNumber,
      streetName,
      unitNumber,
      postalCode,
    } = this.state;
    const values = {};
    return <div></div>;
  }
}

export default Address;
